CREATE DATABASE PROCEDURES;
USE PROCEDURES;

CREATE TABLE CLIENTE(
    ID INT PRIMARY KEY AUTO_INCREMENT, 
    NOME VARCHAR(30) NOT NULL,
    EMAIL VARCHAR(100) NOT NULL UNIQUE,
    SEXO ENUM('Male','Female'),
    SENHA VARCHAR(30),
    CPF CHAR(11) NOT NULL
);



/*PROCEDURES*/

